@import '@/assets/styles/sprite-home.scss';
@import '@/assets/styles/sprite-001.scss';

.nav-bar {
  height: calc(constant(safe-area-inset-top) + 100px);
  height: calc(env(safe-area-inset-top) + 100px);
  &.nav-bar-wideMode {
    height: calc(1 / var(--scale-factor) * 45px);
    :deep(.van-nav-bar) {
      height: calc(1 / var(--scale-factor) * 45px);
      .top-icon-bg {
        width: auto;
        i {
          margin-right: 6px;
        }
      }
    }
  }
  &.nav-bar-message {
    padding-bottom: 60px;
  }
  &--blue,
  &--icons {
    background-color: var(--van-button-primary-background);
    :deep(.van-nav-bar) {
      .van-nav-bar__title {
        color: #fff;
      }
    }
  }
  &--white {
    background-color: #fff;
    :deep(.van-nav-bar) {
      .van-nav-bar__title {
        color: #13161b;
      }
    }
  }
  &--cardActivity {
    background-color: var(--app-spring-festival-activity-theme);
    :deep(.van-nav-bar) {
      .van-nav-bar__title {
        color: #f9db95;
      }
      .van-icon {
        color: #f9db95;
        font-size: 36px;
        font-weight: bolder;
      }
    }
  }
  &--transparent {
    background-color: transparent;
  }

  :deep(.van-nav-bar) {
    background: transparent;
    &.van-hairline--bottom::after {
      border-bottom-width: 0;
    }
    .van-nav-bar__content {
      height: 100px;

      .arrow-back {
        margin-left: 10px;
        transform: rotate(180deg) scale(1.5);
      }
      .van-nav-bar__title {
        height: 100%;
        font-size: 42px;
        display: flex;
        align-items: center;
        font-weight: initial;
      }
      .van-nav-bar__left {
        top: 50%;
        bottom: unset;
        transform: translate3d(0, -50%, 0);
      }
      .van-nav-bar__right {
        color: #fff;
        height: 100%;
        font-size: 42px;
        display: flex;
        align-items: center;
        font-weight: initial;
      }
    }

    .top-icon-bg {
      display: flex;
      align-items: center;
      justify-content: space-between;
      width: 132px;
      height: 50px;
      padding: 0 19px;
      background: v-bind('topIconBg') no-repeat center / cover;
      .unread-sign {
        position: absolute;
        top: -9px;
        right: -12px;
        width: 24px;
        height: 24px;
        line-height: 24px;
        background-color: #d9001c;
        color: #fff;
        font-size: 14px;
        text-align: center;
        border-radius: 50%;
      }
    }
    .onlineCharge {
      background: none;
    }
  }
}
.nav-bar-wideMode {
  :deep(.van-nav-bar) {
    .van-nav-bar__content {
      height: calc(1 / var(--scale-factor) * 45px);
      .van-nav-bar__left {
        padding-left: 0;
      }
      .onlineCharge {
        transform: scale(0.7);
      }
    }
  }
}

